import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
  {
    path: '/alert',
    name: 'alert',
    component: () => import('../views/AlertView.vue')
  },
  {
    path: '/aspect',
    name: 'aspect',
    component: () => import('../views/AspectView.vue')
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
